import{_ as t,a,b as i,c as l,d as o,e as s,f as c,g as p,h as n,i as h,j as m,k as d,l as f,m as u,n as _,o as g,p as b}from"./chunks/qgc_airframe_generic_250_racer.BcrraekL.js";import{_ as P}from"./chunks/grau_b_pixracer_frskys.port_connection.DNhWqeoY.js";import{_ as w,c as k,o as S,ab as e,m as r}from"./chunks/framework.CUflZczI.js";const X=JSON.parse('{"title":"Lumenier QAV-R 5\\" Racer (Pixracer)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md","filePath":"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md"}'),x={name:"uk/frames_multicopter/qav_r_5_kiss_esc_racer.md"},v=e('<h1 id="lumenier-qav-r-5-racer-pixracer" tabindex="-1">Lumenier QAV-R 5&quot; Racer (Pixracer) <a class="header-anchor" href="#lumenier-qav-r-5-racer-pixracer" aria-label="Permalink to &quot;Lumenier QAV-R 5&quot; Racer (Pixracer)&quot;">​</a></h1><p>Lumenier QAV-R 5&quot; FPV Гоночний квадрокоптер - це жорсткий, легкий та швидкий гоночний квадрокоптер FPV з від&#39;ємними руками. Ця тема надає повні інструкції зі збірки та налаштування для використання рамки з контролером польоту <em>Pixracer</em> та регуляторами швидкості <em>KISS 24A Race Edition</em> ESCs. Також надає інформацію про (необов&#39;язкове) налаштування FPV.</p><p>Основна Інформація:</p><ul><li><strong>Каркас:</strong> <a href="http://www.getfpv.com/qav-r-fpv-racing-quadcopter-5.html" target="_blank" rel="noreferrer">Lumenier QAV-R 5&quot;</a></li><li><strong>Контролер польоту:</strong> <a href="./../flight_controller/pixracer.html"> Pixracer</a></li></ul>',4),q=r("p",null,[r("div",{class:"embed-responsive embed-responsive-16by9"},[r("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/wMYgqvsNEwQ",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),C=e('<p><img src="'+t+'" alt="QAV Racer complete"> <img src="'+a+'" alt="QAV Racer complete 2"></p><h2 id="список-деталеи" tabindex="-1">Список деталей <a class="header-anchor" href="#список-деталеи" aria-label="Permalink to &quot;Список деталей&quot;">​</a></h2><h3 id="транспортнии-засіб-потрібнии-для-польоту" tabindex="-1">Транспортний засіб (потрібний для польоту) <a class="header-anchor" href="#транспортнии-засіб-потрібнии-для-польоту" aria-label="Permalink to &quot;Транспортний засіб (потрібний для польоту)&quot;">​</a></h3><ul><li>Автопілот: <a href="./../flight_controller/pixracer.html">Pixracer</a> від <a href="https://store.mrobotics.io/mRo-PixRacer-R14-Official-p/auav-pxrcr-r14-mr.htm" target="_blank" rel="noreferrer">AUAV</a> з WiFi-модулем ESP8266 та силовим модулем <a href="https://store.mrobotics.io/product-p/auav-acsp5-mr.htm" target="_blank" rel="noreferrer">ACSP5</a></li><li>Рама: <a href="http://www.getfpv.com/qav-r-fpv-racing-quadcopter-5.html" target="_blank" rel="noreferrer">Lumenier QAV-R 5&quot;</a></li><li>Двигуни: <a href="http://www.getfpv.com/lumenier-rx2206-11-2350kv-motor.html" target="_blank" rel="noreferrer">Lumenier RX2206-11 2350KV</a></li><li>ESCs: <a href="http://www.getfpv.com/kiss-24a-esc-race-edition-32bit-brushless-motor-ctrl.html" target="_blank" rel="noreferrer">KISS 24A Race Edition</a></li><li>Пропелери: HQProp 5x4.5x3 <a href="http://www.getfpv.com/hqprop-5x4-5x3rg-cw-propeller-3-blade-2-pack-green-nylon-glass-fiber.html" target="_blank" rel="noreferrer">CW</a> <a href="http://www.getfpv.com/hqprop-5x4-5x3g-ccw-propeller-3-blade-2-pack-green-nylon-glass-fiber.html" target="_blank" rel="noreferrer">CCW</a></li><li>GPS / Ext. Магнітометр.: M8N взятий з <a href="./../flight_controller/pixhawk_mini.html">Pixhawk Mini (Discontinued)</a> встановлений та перепрошитий</li><li>Акумулятор: <a href="http://www.getfpv.com/tattu-1800mah-4s-75c-lipo-battery.html" target="_blank" rel="noreferrer">TATTU 1800mAh 4s 75c Lipo</a></li><li>RC Приймач: <a href="http://www.getfpv.com/frsky-x4r-sb-3-16-channel-receiver-w-sbus.html" target="_blank" rel="noreferrer">FrSky X4R-SB</a></li><li>RC Трансмітер: <a href="http://www.getfpv.com/frsky-taranis-x9d-plus-2-4ghz-accst-radio-w-soft-case-mode-2.html" target="_blank" rel="noreferrer">FrSky Taranis</a></li><li>FC dampening: <a href="http://www.getfpv.com/multipurpose-o-ring-set-of-8.html" target="_blank" rel="noreferrer">O-Rings</a></li><li>GPS Кріплення: <a href="http://www.getfpv.com/folding-aluminum-gps-mast-for-dji.html" target="_blank" rel="noreferrer">GPS mast</a></li></ul><h3 id="fpv-необов-язково" tabindex="-1">FPV (необов&#39;язково) <a class="header-anchor" href="#fpv-необов-язково" aria-label="Permalink to &quot;FPV (необов&#39;язково)&quot;">​</a></h3><ul><li>Камера: <a href="https://www.getfpv.com/runcam-swift-rotor-riot-special-edition-ir-block-black.html" target="_blank" rel="noreferrer">RunCam Swift RR Edition</a> <strong>включає в себе обов&#39;язковий високоякісний ширококутний об&#39;єктив від GoPro!</strong></li><li>Відео ТХ: <a href="https://www.getfpv.com/immersionrc-tramp-hv-5-8ghz-video-tx-us-version.html" target="_blank" rel="noreferrer">ImmersionRC Tramp HV 5.8GHz 600mW</a> (Припинено).</li><li>Відеоантени: <a href="http://www.getfpv.com/fpv/antennas/tbs-triumph-5-8ghz-cp-fpv-antenna-3275.html" target="_blank" rel="noreferrer">TBS Triumph 5.8GHz CP</a> (роз&#39;єм SMA підходить для передавача ImmercionRC Tx)</li><li>Роз&#39;єм джерела напруги FPV: <a href="http://www.getfpv.com/male-jst-battery-pigtail-10cm-10pcs-bag.html" target="_blank" rel="noreferrer">Male JST Battery Pigtail</a></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Ці деталі покривають сторону відправлення для стандартного аналогового FM-відео FPV на частоті 5,8 ГГц. Для перегляду відеопотоку в реальному часі вам потрібен сумісний приймач і пристрій відображення.</p></div><h2 id="збирання-базовоі-рами" tabindex="-1">Збирання базової рами <a class="header-anchor" href="#збирання-базовоі-рами" aria-label="Permalink to &quot;Збирання базової рами&quot;">​</a></h2><p>Я зібрав основну центральну плату та руки, як показано у цьому відео між 09:25 та 13:26:</p>',9),A=r("p",null,[r("div",{class:"embed-responsive embed-responsive-16by9"},[r("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/7SIpJccXZjM",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),R=e('<p>Я закріпив чотири двигуни на рамі з кабелями, що виходять у напрямку центру рами. Я використав два з довших від винтів для мотора, які йдуть разом з рамою, для кожного мотора і вставив їх у дві отвори, які знаходяться далі один від одного.</p><h2 id="побудова-силовоі-передачі" tabindex="-1">Побудова силової передачі <a class="header-anchor" href="#побудова-силовоі-передачі" aria-label="Permalink to &quot;Побудова силової передачі&quot;">​</a></h2><p>Регулятори швидкості KISS відомі своєю високою продуктивністю, але вони також мають два недоліки:</p><ul><li>Використовуване програмне забезпечення не є відкритим джерелом (на відміну від BLHeli)</li><li>Немає апаратного пакету з попередньо припаяними дротами та/або вилками (наскільки мені відомо)</li></ul><p>Це означає, що нам потрібно злити принаймні 6 з&#39;єднань на кожному ESC, але це все ще повністю варте цього.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Завжди припаюйте обидві сторони, які ви хочете з&#39;єднати припоєм, перед тим як їх фактично паяти разом. Це зробить його набагато простіше, і ймовірність холодних припояних швів буде меншою.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Переконайтеся, що використовуєте відповідний калібр кабелю для живлення, який транспортує високий струм усім шляхом від батареї до двигунів. Всі сигнальні кабелі можуть бути дуже тонкими у порівнянні.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Поставте термоусадку на кабелі, перш ніж почнете паяти! Після успішного функціонального тесту термоусадження регуляторів швидкості, модуля живлення та вільно плаваючих незізольованих припоєних з&#39;єднань захистить їх від бруду, вологи та фізичних пошкоджень.</p></div><h3 id="двигуни" tabindex="-1">Двигуни <a class="header-anchor" href="#двигуни" aria-label="Permalink to &quot;Двигуни&quot;">​</a></h3><p>Спочатку я відрізав всі три кабелі двигуна, щоб вони безпосередньо відповідали, коли регулятори швидкості монтуються на руки, зсунуті до центру, але все ще залишають достатньо вільного місця для легкого розміщення деталей і не створюють жодного напруження на кабелях. Потім я їх паяв у порядку, у якому вони виходять з мотора, на вихідні контакти регуляторів швидкості, які орієнтовані так, щоб перемикаючі MOS-FET-перетворювачі були спрямовані вгору для забезпечення хорошого охолодження повітрям під час польоту. Вибір цього кабеля призвів до того, що всі двигуни оберталися проти годинникової стрілки у моїх тестах, і я змінив напрямок обертання за необхідності, з&#39;єднавши відповідний <a href="https://1.bp.blogspot.com/-JZoWC1LjLis/VtMP6XdU9AI/AAAAAAAAAiU/4dygNp0hpwc/s640/KISS-ESC-2-5S-24A-race-edition-32bit-brushless-motor-ctrl.jpg" target="_blank" rel="noreferrer">паяльний перемичку JP1</a> для відповідності конфігурації <a href="./../airframes/airframe_reference.html#quadrotor-x">Квадрокоптер x</a>.</p><p><img src="'+i+'" alt="Power motor connections"></p><h3 id="модуль-живлення" tabindex="-1">Модуль живлення <a class="header-anchor" href="#модуль-живлення" aria-label="Permalink to &quot;Модуль живлення&quot;">​</a></h3><p>Спочатку я припаяв роз&#39;єм XT60, що йде в комплекті з рамою, до маркованого боку батареї модуля живлення <em>ACSP5</em>, який поставляється з Pixracer, і додав конденсатор elco, що поставляється з модулем живлення, з правильною полярністю на тій же стороні.</p><p><img src="'+l+'" alt="ACSP5 power module"></p><p>Тепер настає складна частина. Я зварив всі чотири порти напруги ESC + та - до відповідного патча на позначеному боці виходу ESC модуля живлення. Переконайтеся, що тут немає жодного холодного припою, оскільки квадрокоптер не завершиться добре з вільним з&#39;єднанням у польоті. Використання додаткової плати розподілу потужності рами зробило би роботу набагато простіше, але також займає занадто багато місця на такій маленькій рамі...</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо ви також включаєте частини FPV, не забудьте також припаяти свій чоловічий роз&#39;єм живлення JST до вихідного боку модуля живлення. Вам знадобиться це для вашого <a href="#fpv-setup">налаштування FPV</a> пізніше.</p></div><p><img src="'+o+'" alt="Power module"></p><h3 id="сигнальні-кабелі" tabindex="-1">Сигнальні кабелі <a class="header-anchor" href="#сигнальні-кабелі" aria-label="Permalink to &quot;Сигнальні кабелі&quot;">​</a></h3><p>Я використовував тонкі кабелі зі стандартизованим роз&#39;ємом заголовка шпильки, які були вирізані навпіл для сигналу ESC, оскільки це дозволить легко вставити їх на контакти Pixracer пізніше. Лише позначений порт <code>PWM</code> на <a href="https://1.bp.blogspot.com/-0huvLXoOygM/VtMNAOGkE5I/AAAAAAAAAiA/eNNuuySFeRY/s640/KISS-ESC-2-5S-24A-race-edition-32bit-brushless-motor-ctrl.jpg" target="_blank" rel="noreferrer">KISS ESCs</a> є необхідним для польоту. Вони будуть підключені до правильного вихідного сигналу двигуна pixracer. Порт <code>TLM</code> призначений для телеметрії ESC, і я їх припаяв для майбутнього використання, оскільки необхідний протокол наразі не підтримується PX4.</p><p><img src="'+s+'" alt="Power ESC signals"></p><p>Я протестував всі пари моторів ESC та їх напрямки обертання за допомогою дешевого тестера PWM серво до продовження.</p><p><img src="'+c+'" alt="Motor test"></p><p><a id="mounting"></a></p><h2 id="підключення-встановлення-електроніки" tabindex="-1">Підключення &amp; встановлення електроніки <a class="header-anchor" href="#підключення-встановлення-електроніки" aria-label="Permalink to &quot;Підключення &amp; встановлення електроніки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Перевірте подвійно призначення контактів кожного підключеного вами компонента. На жаль, не кожен апаратний компонент там є підключенням і грою, навіть якщо на перший погляд може здатися, що це так.</p></div><p>Для цього кроку вам знадобиться <a href="./../flight_controller/pixracer.html">технічна документація Pixracer</a>, щоб знайти всі необхідні роз&#39;єми. Я намагався прокласти всі кабелі під дошкою Pixracer, щоб мати чисту конструкцію та заощадити місце для камери FPV та передавача у майбутньому.</p><p>Я змонтував Pixracer, використовуючи нейлонові прокладки та гвинти, які поставляються разом із рамою QAV-R, але <strong>поклав кілька невеликих ущільнювачів O-кільців</strong> між платою та прокладками, щоб додати трохи амортизації вібрацій. Переконайтеся, що ви <strong>не затягуєте гвинти занадто сильно або слабко</strong>, робіть це так, щоб дошка чітко доторкалася до обох сторін, але не була затиснута з будь-якою напругою. Дошка не повинна ніяк висіти, але трохи рухатися, якщо ви натиснете на неї пальцями.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Це може суттєво впливати на рівень шуму вібрації, який вимірюють датчики гіроскопа та акселерометра під час польоту.</p></div><p><img src="'+p+'" alt=""></p><p><img src="'+n+'" alt="Center connections"> <img src="'+h+'" alt="Center overview"></p><h3 id="приимач-rc" tabindex="-1">Приймач RC <a class="header-anchor" href="#приимач-rc" aria-label="Permalink to &quot;Приймач RC&quot;">​</a></h3><p>Я підключив приймач FrSky S-BUS за допомогою кабелю, відправленого з Pixracer, але відгалуження з непотрібним кабелем відрізав.</p><p>Для розумного порту телеметрії я використав кабель, який поставляється з приймачем. Я видалив усі непотрібні шпильки з роз&#39;єму за допомогою пінцета і перемкнув білий вільний кінець кабелю на правильну шпильку роз&#39;єму, щоб мати підключений сигнал &quot;розумний&quot;. Потім я припаяв вільний кінець до кабельного вводу порту FrSky, дотримуючись цієї схеми:</p><p><img src="'+P+'" alt="schematic"></p><p>Я також пропустив земельний (GND) контакт, оскільки, подібно до позитивного контакту живлення напруги, він вже підключений через кабель RCin S-BUS.</p><p><img src="'+m+'" alt=""></p><h3 id="кріплення-антени-rc" tabindex="-1">Кріплення антени RC <a class="header-anchor" href="#кріплення-антени-rc" aria-label="Permalink to &quot;Кріплення антени RC&quot;">​</a></h3><p>Щоб мати хороше з&#39;єднання RC, не ризикуючи мати антену в гвинтах, я використовував метод міцного кріплення за допомогою термоусадки та затяжок.</p><p><img src="'+d+'" alt=""></p><p>Для цього методу ви відрізаєте великий кінець з отвором від застібки-ґудзика, складаєте решту разом з антенним кабелем через довгий термоусадку та монтуєте це на ваших рамних просторах, використовуючи більшу, але коротшу термоусадку.</p><p><img src="'+f+'" alt=""></p><h3 id="сигнал-esc" tabindex="-1">Сигнал ESC <a class="header-anchor" href="#сигнал-esc" aria-label="Permalink to &quot;Сигнал ESC&quot;">​</a></h3><p>Для сигналів ESC я дотримувався <a href="./../flight_controller/pixracer.html">апаратної документації Pixracer</a> та схеми нумерації моторів <a href="./../airframes/airframe_reference.html#quadrotor-x">Quadrotor x configuration</a>. Оскільки у нас немає з&#39;єднань землі або позитивного напруги BEC, ми підключаємо кабелі сигналу ESC <code>PWM</code> кожен до його верхніх контактів відповідного вихідного роз&#39;єму.</p><h3 id="gps-зовнішніи-магнітометр" tabindex="-1">GPS / Зовнішній магнітометр <a class="header-anchor" href="#gps-зовнішніи-магнітометр" aria-label="Permalink to &quot;GPS / Зовнішній магнітометр&quot;">​</a></h3><p>Я взяв кабель GPS, який підходить до роз&#39;єму використаного GPS і поставляється ​​з набором Pixracer. На жаль, призначення контакту було абсолютно неправильним, і я знову повторно використовував ханцерів згідно з <a href="./../flight_controller/pixhawk_mini.html#connector-pin-assignments-pin-outs">3DR Pixhawk посібник користувача</a> з GPS портом.</p><h4 id="pixracer-gps-i2c-port" tabindex="-1">Pixracer GPS/I2C Port <a class="header-anchor" href="#pixracer-gps-i2c-port" aria-label="Permalink to &quot;Pixracer GPS/I2C Port&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Призначення</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>SDA</td></tr><tr><td>3</td><td>SCL</td></tr><tr><td>4</td><td>RX</td></tr><tr><td>5</td><td>TX</td></tr><tr><td>6</td><td>+5V</td></tr></tbody></table><h4 id="m8n-3dr-pixhawk-mini-gps-connector" tabindex="-1">M8N 3DR Pixhawk mini GPS Connector <a class="header-anchor" href="#m8n-3dr-pixhawk-mini-gps-connector" aria-label="Permalink to &quot;M8N 3DR Pixhawk mini GPS Connector&quot;">​</a></h4><table><thead><tr><th>Pin</th><th>Призначення</th><th>Connect to Pixracer Pin</th></tr></thead><tbody><tr><td>1 (red)</td><td>SCL</td><td>3</td></tr><tr><td>2</td><td>SDA</td><td>2</td></tr><tr><td>3</td><td>VCC 5V</td><td>6</td></tr><tr><td>4</td><td>RX</td><td>5</td></tr><tr><td>5</td><td>TX</td><td>4</td></tr><tr><td>6</td><td>GND</td><td>1</td></tr></tbody></table><p>Я встановив модуль GPS, використовуючи перерахований загальний мультікоптерний стійку GPS, оскільки встановлення його ближче до основного корпусу зробило показання магнітометра абсолютно непридатними для використання. Експеримент, в якому модуль було прямо закріплено на далекому задньому краї рами, показав, що шум величини магнітометра в шість разів ймовірно спричинений магнітним полем струмів ESC. Зверніть увагу, що я скоротив мачту на ~2 см, щоб вона краще підходила за довжиною кабелю та розмірами рами. Модуль GPS приклеєний двостороннім скотчем до верхньої плити мачти.</p><h2 id="налаштування-fpv" tabindex="-1">Налаштування FPV <a class="header-anchor" href="#налаштування-fpv" aria-label="Permalink to &quot;Налаштування FPV&quot;">​</a></h2><p>Це інструкція для необов&#39;язкової передачі відео у реальному часі FPV на частоті 5,8 ГГц. Вам знадобляться додаткові частини FPV, перераховані в початковій частині. Трансляція FPV, описана тут, є електронно незалежною від контролера польоту, вона бере тільки напругу батареї після модуля живлення.</p><p>Спочатку я зробив контрольний тест, щоб переконатися, що все працює правильно. Для цього підключіть кабель відеосигналу, який постачається разом з вашим передавачем, і підключіть його до задньої частини вашої FPV-камери та до відповідного роз&#39;єму передавача. Закрутіть, а потім підключіть штекер живлення JST до вашого транспортного засобу або до іншого джерела напруги. Світлодіод передавача повинен загорітися. Використовуйте свій пристрій приймача 5,8 Ггц, налаштований на правильний канал, щоб перевірити відео. Щоб налаштувати передавач на інший канал і налаштувати потужність передачі, зверніться до <a href="https://www.immersionrc.com/?download=5016" target="_blank" rel="noreferrer">Посібника користувача Tramp HV</a>.</p><p><img src="'+u+'" alt="FPV wiring"></p><p>Як ви можете побачити, я закріпив передавач зсередини на &quot;даху&quot; рами, використовуючи затискач. Завжди вставляйте самоклеючий шматок піни між, коли монтуєте електроніку, як цю, щоб уникнути фізичних пошкоджень під час польоту. Переконайтеся, що передавач розташований таким чином, щоб роз&#39;єм антени відповідав відведеній отвору рамки.</p><p><img src="'+_+'" alt="Transmitter"></p><p>Величезна камера FPV, встановлена в частині списку, має не лише найкращий об&#39;єктив FPV, який я бачив до цього, але також включає кілька кріплень для камери, одне з яких дуже гнучке для налаштування кута камери і гарно вписується в рамку QAV-R. Я змонтував це, як ви можете побачити на наступному зображенні. Два гвинти та гайки для фіксації кронштейну камери до рами були взяті з запасних, що залишилися від комплекту рами.</p><p><img src="'+g+'" alt="Camera"></p><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><p><em>QGroundControl</em> використовується для встановлення автопілота PX4 та його налаштування / налаштування для рами. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Завантажте та встановіть</a> <em>QGroundControl</em> для вашої платформи.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Повні інструкції щодо встановлення та налаштування PX4 можна знайти в <a href="./../config/">Основна конфігурація</a>.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Завжди переконайтеся, що під час будь-якої початкової конфігурації вашого транспортного засобу або батарею, або гвинти фізично вилучено. Краще перестрахуватися, ніж потім шкодувати!</p></div><p>Спочатку оновіть прошивку, конструкцію та відображення актуаторів:</p><ul><li><p><a href="./../config/firmware.html">Прошивка</a></p></li><li><p><a href="./../config/airframe.html">Планер</a></p><p>Вам потрібно вибрати планер <em>Generic 250 Racer</em> (<strong>Quadrotor x &gt; Generic 250 Racer</strong>).</p><p><img src="'+b+'" alt="QGC airframe selection of generic 250 racer"></p></li><li><p><a href="./../config/actuators.html">Актуатори</a></p><ul><li>Вам не потрібно оновлювати геометрію транспортного засобу.</li><li>Призначте функції приводу до актуаторів, щоб відповідати вашому підключенню.</li><li>Перевірте конфігурацію, використовуючи слайдери.</li></ul></li></ul><p>Потім виконайте обов&#39;язкове налаштування / калібрування:</p><ul><li><a href="./../config/flight_controller_orientation.html">Орієнтація сенсора</a></li><li><a href="./../config/compass.html">Компас</a></li><li><a href="./../config/accelerometer.html">Акселерометр</a></li><li><a href="./../config/level_horizon_calibration.html">Калібрування рівня горизонту</a></li><li><a href="./../config/radio.html">Налаштування радіо</a></li><li><a href="./../config/flight_mode.html">Режими польоту</a></li></ul><p>В ідеалі ви також повинні зробити:</p><ul><li><a href="./../advanced_config/esc_calibration.html">Калібрування ESC</a></li><li><a href="./../config/battery.html">Регулювання оцінки заряду акумулятора</a><ul><li>4S (4 елементи LiPo) з напругою зарядженого елемента 4,15 В і напругою розрядженого елемента 3,5 В (або відповідні значення для вашого акумулятора).</li></ul></li><li><a href="./../config/safety.html">Безпека</a></li></ul><h3 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h3><p>Набори вибору конструкції встановлюють параметри автопілота <em>за замовчуванням</em> для рами. Ці вистачають для польоту, але це добра ідея налаштувати параметри для конкретної конструкції рами.</p><p>Для інструкцій щодо того, як розпочати, почніть з <a href="./../config/autotune.html">Автоналаштування</a>.</p>',71),V=[v,q,C,A,R];function T(E,y,F,G,I,N){return S(),k("div",null,V)}const D=w(x,[["render",T]]);export{X as __pageData,D as default};
